import React from 'react';

const Navbar = () => {
  return (
    <nav className="bg-blue-600 p-4">
      <div className="container mx-auto">
        <h1 className="text-white text-2xl font-semibold">Mnada Auctioneering</h1>
      </div>
    </nav>
  );
};

export default Navbar;
